import { useState } from "react";
import "./App.css";

function App() {
  const [name, setName] = useState("");
  const [datetime, setDatetime] = useState("");
  const [description, setDescription] = useState("");

  function addTransaction(ev) {
    ev.preventDefault();
    const url = process.env.REACT_APP_API_URL + "/transaction";
    fetch(url, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ name, description, datetime }),
    })
      .then((response) => {
        response
          .json()
          .then((json) => {
            console.log("result", json);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
        console.log(err);
      });
  }
  return (
    <div>
      <nav className="navbar">
        <h1>MoneyTrack</h1>
        <main className="parent">
          <div className="formdiv">
            <h1>&#8377;5000</h1>
            <form onSubmit={addTransaction}>
              <div className="basics">
                <input
                  type="text"
                  value={name}
                  onChange={(ev) => setName(ev.target.value)}
                  placeholder={"New Entry Here"}
                />
                <input
                  type="datetime-local"
                  value={datetime}
                  onChange={(ev) => setDatetime(ev.target.value)}
                />
              </div>
              <div className="description">
                <input
                  type="text"
                  value={description}
                  onChange={(ev) => setDescription(ev.target.value)}
                  placeholder={"Description (Upto 25 letters)"}
                />
              </div>
              <button type="submit">Add Transaction</button>
            </form>
          </div>
          <div className="panel">
            <div className="transaction">
              <div className="left">
                <div className="name"> Samsung Tv</div>
                <div className="itemdescription">New TV</div>
              </div>
              <div className="right">
                <div className="price red"> - &#8377; 700 </div>
                <div className="datetime">2023-12-23 20:00</div>
              </div>
            </div>
            <div className="transaction">
              <div className="left">
                <div className="name"> Bonus</div>
                <div className="itemdescription">New TV</div>
              </div>
              <div className="right">
                <div className="price green"> &#8377; 300 </div>
                <div className="datetime">2023-12-23 20:00</div>
              </div>
            </div>
            <div className="transaction">
              <div className="left">
                <div className="name"> NightOut</div>
                <div className="itemdescription">New TV</div>
              </div>
              <div className="right">
                <div className="price red">- &#8377; 200 </div>
                <div className="datetime">2023-12-23 20:00</div>
              </div>
            </div>
          </div>
        </main>
      </nav>
    </div>
  );
}

export default App;
